  const listaNumeros = Numeros.map(
    (e,i)=><table key={i}><td>{e}</td></table>)


  useEffect(() =>{
    console.log(numeros)

  },[numeros])






return (
  <div>
    <div>
      {listaNumeros}
    </div>
